import React, {useEffect, useState} from 'react';
import logo from './logo.svg';
import './App.css';

interface Product{
  id: string;
  name: string;
  sku: string;
}

function App() {
  const [products, setProducts] = useState<Product[]>([])
  useEffect(() => {
    fetch('http://localhost:8080/products').then((data) => setProducts(data.body)).catch(e => console.error(e))
  }, []);
  return (
    <div className="App">
      {products.map((p) => (
        <div>
          <h1>{p.id}</h1>
          <h2>{p.name}</h2>
          <h3>{p.sku}</h3>
        </div>
      ))}
    </div>
  );
}

export default App;
